import React from 'react'
import { Menu, MenuButton, MenuList, MenuItem } from "@reach/menu-button";
import { useNavigate } from 'react-router-dom'
import './DropDownMenu.css'

export default function DropDownMenu() {
  const navigate = useNavigate()

  const onSubscriptClick = () => {
    navigate('/subscriptions')
  }

  const onAddressClick = () => {
    navigate('/home')
  }

  const onMessagesClick = () => {
    navigate('/home')
  }

  const onContactClick = () => {
    navigate('/home')
  }

  return (
    <Menu className={'dropdown-menu'}>
      <MenuButton className={'dropButton'} onClick={onSubscriptClick} >See My Subscription</MenuButton>
      <MenuButton className={'dropButton'} onClick={onAddressClick} >Addresses</MenuButton>
      <MenuButton className={'dropButton'} onClick={onMessagesClick} >Messages</MenuButton>
      <MenuButton className={'dropButton'} onClick={onContactClick} >Contact Jarvis</MenuButton>
    </Menu>
  )
}
